import React from 'react';
import Header from "../Header/Header";
import s from "./Layout.module.css"

const Layout = (props) => {
    return (
        <div className={s.wrapper}>
            <Header />
                <main>{props.children}</main>
            <footer></footer>
        </div>
    );
};

export default Layout;
